import React from "react";
import './pagenotfound.css'

const pageFound = () => {
    return (
        <main id="boxes">
        <div>
            <h1>404!</h1>
        </div>
        <div id="column2">

        </div>
        <div id="column3">
            <img src="logo/BillyLogo.png" alt="Billy" width="140" height="50" style="margin-bottom:-40px;"/>
            <pre>Sorry, this page
isn't available!</pre>
            <button type="submit" name="submit" onclick="window.location.href = '/user/shop.aspx';">Go to home</button>
        </div>
    </main>   
    );
};

export default pageFound;
